&quot;Man hat deudlich g'sehn, dass ich mich nicht nach drauße begebne habe&quot;
Komisch, da sagen die Video von der Gegenseite aber was anderes. Er glaubt halt echt er kann alle hinters Licht führen, nur weil er dann den Pausenscreen reinhaut, während er ans Tor geht.
Das witzige ist nämlich: Wonggl hat von der Polizei die Auflage, nicht mehr ans Tor zu gehen, wenn Besucher kommen, um die Situation zu entschärfen. Er hält sich natürlich nicht dran. Er filmt sich bloß nicht mehr dabei.
